import React from "react";

import "./Sidebar.css";
const sidebar = (props) => {
  return (
    <div className="sidebar">
      <h1 class="logo" style={{fontSize: 20}}>
        <span class="text-primary">
          <i class="fas fa-book-open"></i> Flake
        </span>
        Software
      </h1>
      <hr style={{color:"red"}}/>
      <nav>
        <ul>
          <li><a>Overview</a></li>
          <li><a>Collections</a></li>
          <li><a>Clients</a></li>
        </ul>
      </nav>
    </div>
  );
};

export default sidebar;
